import React, { useState } from 'react';
import axios from 'axios';

export default function CreateTeam() {
    const [nameTeam, setNameTeam] = useState('');
    const [logo, setLogo] = useState('');
    const [colorShirt, setColorShirt] = useState('');
    const [players, setPlayers] = useState([]);

    const handleAddPlayer = () => {
        // Thêm một người chơi mới vào mảng players
        setPlayers([...players, { name: '', email: '', phone: '', age: '' }]);
    };

    const handleChangePlayer = (index, event) => {
        const { name, value } = event.target;
        const updatedPlayers = [...players];
        updatedPlayers[index][name] = value;
        setPlayers(updatedPlayers);
    };

    const handleSubmit = async (event) => {
        event.preventDefault();
        try {
            const teamData = { nameTeam, logo, colorShirt, players };
            const response = await axios.post('http://localhost:3001/teams/createTeam', teamData);
            console.log(response.data);
            // Reset form after successful submission
            setNameTeam('');
            setLogo('');
            setColorShirt('');
            setPlayers([]);
            alert('Team created successfully!');
        } catch (error) {
            console.error('Error creating team:', error);
            alert('Failed to create team. Please try again.');
        }
    };

    return (
        <div>
            <h1>Create Team</h1>
            <form onSubmit={handleSubmit}>
                <label htmlFor="nameTeam">Team Name:</label>
                <input type="text" id="nameTeam" name="nameTeam" value={nameTeam} onChange={(e) => setNameTeam(e.target.value)} />
                <br />
                <label htmlFor="logo">Logo:</label>
                <input type="text" id="logo" name="logo" value={logo} onChange={(e) => setLogo(e.target.value)} />
                <br />
                <label htmlFor="colorShirt">Color Shirt:</label>
                <input type="text" id="colorShirt" name="colorShirt" value={colorShirt} onChange={(e) => setColorShirt(e.target.value)} />
                <br />
                <h3>Players:</h3>
                {players.map((player, index) => (
                    <div key={index}>
                        <label htmlFor={`name-${index}`}>Name:</label>
                        <input type="text" id={`name-${index}`} name="name" value={player.name} onChange={(e) => handleChangePlayer(index, e)} />
                        <label htmlFor={`email-${index}`}>Email:</label>
                        <input type="text" id={`email-${index}`} name="email" value={player.email} onChange={(e) => handleChangePlayer(index, e)} />
                        <label htmlFor={`phone-${index}`}>Phone:</label>
                        <input type="text" id={`phone-${index}`} name="phone" value={player.phone} onChange={(e) => handleChangePlayer(index, e)} />
                        <label htmlFor={`age-${index}`}>Age:</label>
                        <input type="text" id={`age-${index}`} name="age" value={player.age} onChange={(e) => handleChangePlayer(index, e)} />
                    </div>
                ))}
                <button type="button" onClick={handleAddPlayer}>Add Player</button>
                <br />
                <button type="submit">Create Team</button>
            </form>
        </div>
    );
}
